import React from 'react';
import ReactDOM from 'react-dom';
import Switch from './components/Switch';
import './styles/Style.css';

ReactDOM.render(
  <React.StrictMode>
    <Switch />
  </React.StrictMode>,
  document.getElementById('root')
);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Switch />
  </React.StrictMode>
);
